) ENGINE=InnoDB AUTO_INCREMENT=44 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

INSERT INTO recetas VALUES("Macarrones a la boloñesa","Jose Miguel","Pasta, Carne","La boloñesa es una salsa que lleva carne de res molida, e incluso es más popular que el pesto. Se trata de una salsa espesa, originaria de la ciudad de Bolonia, que se prepara con carne picada de res, de cerdo o de buey, zanahoria, cebolla, apio, tomate, etcétera, aunque existen muchísimas variaciones con diversos ingredientes y especias. Para esta receta de macarrones a la boloñesa vamos a intentar seguir la receta original para pasar el examen de la mamma italiana.","400 g de macarrones 500 g de carne picada de ternera 500 g de tomate natural triturado 100 gr de queso rallado especial para gratinar aceite de oliva virgen extra 1 zanahoria 150 g de apio 30 g de mantequilla 1/2 cebolla 1 vasito de vino de guiso Sal Pimienta Nuez moscada Albahaca","Para hacer los macarrones a la boloñesa lo primero que debes hacer es pelar la cebolla y picarla en dados pequeños. Pela la zanahoria y pícala en dados de igual tamaño. Lava el apio, quítale las hebras de las ramas y pícalo en cubitos. Coloca la mantequilla en una olla junto con el aceite de oliva y lleva al fuego. Cuando coja temperatura agrega las verduras y pocha a fuego suave. Cuando las verduras estén blandas y la cebolla transparente, sube un poco la temperatura e incorpora la carne y el tomate natural triturado. Revuelve con una cuchara de madera e incorpora la leche, la nuez moscada recién molida, la sal y la pimienta negra molida al gusto. Reduce la temperatura, tapa y deja cocer a fuego lento durante 60 minutos. Cuando la salsa boloñesa esté lista, llena una olla con agua y colócala en el fuego. Cuando rompa hervor echa los macarrones y un puñado de sal y cocina según las indicaciones del fabricante. Escurre la pasta al dente y sirve la macarrones a la boloñesa con queso parmesano rallado por encima y algunas hojas de albahaca.","ÿØÿà\0JFIF\0\0\0\0\0\0ÿâICC_PROFILE\0\0\0lcms\0\0mntrRGB XYZ Ü\0\0\0\0)\09acspAPPL\0\