INSERT INTO recetas VALUES("Arroz tres delicias","Jose Miguel","Arroz","Aprende cómo hacer arroz tres delicias chino, el famoso plato oriental que combina a la perfección mariscos, pollo y vegetales. Añádele un sabor agridulce o salado según tus gustos y anímate a preparar un arroz diferente al de cada día."," ½ kilogramo de arroz largo 100 gramos de gambas peladas 100 gramos de jamón York 1 unidad de pechuga de pollo 2 unidades de Huevo 50 gramos de guisantes 6 unidades de champiñón 1 unidad de cebolla 4 cucharadas soperas de Aceite 1 pizca de Sal y Pimienta ","Para empezar a preparara este delicioso arroz oriental, lo primero que haremos será alistar los ingredientes. Para ello, corta finamente la cebolla, lamina los champiñones, corta el pollo en trocitos de un bocado y el jamón york también córtalo en cuadros. También tendrás que hacer una tortilla francesa con los dos huevos y trocearla. A continuación, caliente el aceite en una sartén y sofríe la cebolla con los champiñones y el pollo. Saltea hasta que los ingredientes empiecen a tomar color. Cuando el pollo se haya dorado ligeramente añade a la preparación del arroz tres delicias el jamón york y remueve todo muy bien. Ahora le toca el turno al resto de ingredientes. Añade los trozos de tortilla francesa y las gambas al sofrito. Sazona con un poco de sal y pimienta y reserva.  Aparte, dale un hervor a los guisantes y cocina el arroz blanco de forma tradicional. Cuando este listo, pasa por agua fría y escurre el arroz.   Ahora lleva los ingredientes del arroz chino a un bol y mezcla todo hasta que se integren por completo. Si deseas, como ingrediente opcional, puedes añadir un poco de salsa soja o salsa agridulce y mezclar con el arroz.  Sirve y disfruta del arroz tres delicias chino para comer o en la hora de la cena. Te recomiendo acompañarlo con una ensalada china agridulce. Y recuerda que si te ha gustado esta receta puedes encontrar muchas más en mi blog La Cocina de Juani.","ÿØÿà\0JFIF\0\0\0\0\0\0ÿÛ\