INSERT INTO recetas VALUES("Risotto de calabaza","Jose","Arroz","El risotto es una técnica culinaria italiana que tiene su origen en el noroeste del país, concretamente en el Piamonte, donde tradicionalmente había abundancia de arroz. Cuando se cocina el risotto, el arroz cuece poco a poco con el resto de ingredientes del plato, no por separado. Verás como en este risotto de calabaza y champiñones uno de los distintivos es el queso parmesano, fundamental en cualquier variedad de risotto."," 1 kilogramo de calabaza 1 Cebolleta 120 gramos de champiñón 60 gramos de Parmesano 1 chorro de Aceite de oliva 150 gramos de arroz blanco 1 pizca de Sal 1 pizca de Pimienta negra 700 mililitros de caldo de verduras ","Reunimos todos los ingredientes para elaborar el risotto de calabaza y champiñones. Si no tienes caldo de verduras, puedes preparar uno mientras elaborados el resto de la receta. Para ello, pon a hervir unas verduras en abundante agua. Puedes incluir cebolla, puerro, apio y zanahoria. Deja hervir durante media hora y pon un poco de sal. Mientras se hace el caldo de verduras, hamos un sofrito con la cebolleta picada y un poco de aceite de oliva. Dejamos que se cocine durante 4 minutos. Agregamos la calabaza pelada y cortada en cuadraditos. Cuanto más pequeña la cortes antes se cocinará. Es el momento de incorporar los champiñones fileteados y limpios a este risotto de calabaza. Dejamos cocinar durante 2-3 minutos. Echamos el arroz, rehogamos mezclando bien con el resto de ingredientes y cubrimos con el caldo de verduras. Vamos moviendo el risotto de calabaza y champiñones poco a poco y dejamos que reduzca el agua. El tiempo de cocción es de unos 20-22 minutos, dependiendo del tipo de arroz.  Es fundamental que el risotto quede cremoso, que no le falte caldo. Cuando tengamos el arroz casi listo, ponemos un poco de parmesano rallado y movemos para que se integre su sabor. Servimos el risotto de calabaza y champiñones con un poco más de parmesano rallado por encima.","ÿ